import ListItem from "./ListItem";
import "./List.css";

const List = (props) => {
    console.log(props)
  return (
    <div style={{ margin: "0px" }}>
      <ul>
        {props.ertekek.map((item) => (
          <ListItem
            key={item.id}
            onDelete={props.onDeleteItem}
            szam={item.id}
            name={item.name}
            age={item.age}
          />
        ))}
      </ul>
    </div>
  );
};

export default List;
